import React, { Component } from 'react';
import './PopUp.css';


export default class PopUp extends Component {
    handleclick = () => {
        this.props.toggle();
    };

    render() {
        return (
            <div className="modal">
                <div className="modal_content">
                    <span className="close" onClick={this.handleClick}>&times;</span>
                    <form>
                        <h2>Login in</h2>
                        <label>
                            Name:
                            <input type="text" name="name" />
                        </label>
                        <br />
                        <input type="submit" />
                    </form>

                </div>
            </div>     
        );
    }
}
